INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES (0, 1033501040, 6, "急に牛乳と卵が欲しいっつうから\n何かと思ったけんど、まさか\nオラのためにこんな立派なケーキ\n用意してくれてただなんてな！", 1, 1033501, "", 103311, 1, 11, 0);
INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES ("", 1033501041, "", "", "", 1033501, "", 0, "", 91, "");
