INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES (0, 1051501040, 7, "誕生日を祝ってくれてありがとう。\nいくつになってもお祝いして\nもらえるのはうれしいものね。", 1, 1051501, "", 105111, 1, 11, 0);
