INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES (0, 1051501043, 4, "え、このケーキ君の手作りなの？\nなによ至れり尽くせりじゃない。", 1, 1051501, "", 105111, 1, 11, 0);
