INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES (0, 1052501046, 5, "少しでもお返ししたいけど……\nあなたは何かしてほしいことはある？\nえ？　私の誕生日だから私が\n喜んでくれたらうれしい……？", 1, 1052501, "", 105211, 1, 11, 0);
INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES ("", 1052501047, "", "", "", 1052501, "", 0, "", 91, "");
