INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES (0, 1052501052, 4, "ケーキをあーんしてもらってもいい？\n一口だけ、一口だけでいいから！\nいいの？　ありがとう！\n最高の誕生日だわ！", 1, 1052501, "", 105211, 1, 11, 0);
