INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES (0, 1110501046, 4, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 1, 1110501, "", 111011, 1, 11, 0);
